using Components;using System;using MessagePack;using HECSFramework.Serialize;using Commands;namespace HECSFramework.Core{	[MessagePackObject, Serializable]	public struct HealthComponentResolver : IResolver<HealthComponent>, IResolver<HealthComponentResolver,HealthComponent>, IData	{		public HealthComponentResolver In(ref HealthComponent healthcomponent)		{			return this;		}		public void Out(ref IEntity entity)		{			var local = entity.GetHealthComponent();			Out(ref local);		}		public void Out(ref HealthComponent healthcomponent)		{		}	}}